// Quality colors for display
export const QUALITY_COLORS = {
  legendary: '#ff8c00',
  epic: '#a855f7',
  elite: '#3b82f6',
  advanced: '#22c55e',
  normal: '#9ca3af'
};

// Quality order for sorting
export const QUALITY_ORDER = ['legendary', 'epic', 'elite', 'advanced', 'normal'];

// Slot types
export const SLOT_TYPES = ['WEAPON', 'HELMET', 'CHEST', 'GLOVES', 'LEGS', 'BOOTS', 'ACCESSORY'];

// Stat categories for calculations
export const STAT_CATEGORIES = {
  attack: ['cavalryAttack', 'infantryAttack', 'archerAttack', 'siegeAttack', 'troopAttack'],
  defense: ['cavalryDefense', 'infantryDefense', 'archerDefense', 'siegeDefense', 'troopDefense'],
  health: ['cavalryHealth', 'infantryHealth', 'archerHealth', 'siegeHealth', 'troopHealth'],
  marchSpeed: ['cavalryMarchSpeed', 'infantryMarchSpeed', 'archerMarchSpeed', 'siegeMarchSpeed', 'troopMarchSpeed']
};

// Helper function to calculate total stats from equipment array
export function calculateTotalStats(selectedEquipment) {
  const totals = {
    cavalryAttack: 0, cavalryDefense: 0, cavalryHealth: 0, cavalryMarchSpeed: 0,
    infantryAttack: 0, infantryDefense: 0, infantryHealth: 0, infantryMarchSpeed: 0,
    archerAttack: 0, archerDefense: 0, archerHealth: 0, archerMarchSpeed: 0,
    siegeAttack: 0, siegeDefense: 0, siegeHealth: 0, siegeMarchSpeed: 0,
    troopAttack: 0, troopDefense: 0, troopHealth: 0, troopMarchSpeed: 0
  };

  selectedEquipment.forEach(eq => {
    if (eq && eq.stats) {
      Object.keys(totals).forEach(stat => {
        totals[stat] += eq.stats[stat] || 0;
      });
    }
  });

  // Apply troop bonuses to all troop types
  ['cavalry', 'infantry', 'archer', 'siege'].forEach(troopType => {
    totals[troopType + 'Attack'] += totals.troopAttack;
    totals[troopType + 'Defense'] += totals.troopDefense;
    totals[troopType + 'Health'] += totals.troopHealth;
    totals[troopType + 'MarchSpeed'] += totals.troopMarchSpeed;
  });

  return totals;
}

// Helper function to calculate total materials needed
export function calculateTotalMaterials(selectedEquipment) {
  const totals = { leather: 0, iron: 0, ebony: 0, bone: 0, gold: 0 };
  
  selectedEquipment.forEach(eq => {
    if (eq && eq.materials) {
      totals.leather += eq.materials.leather || 0;
      totals.iron += eq.materials.iron || 0;
      totals.ebony += eq.materials.ebony || 0;
      totals.bone += eq.materials.bone || 0;
    }
    if (eq && eq.goldCost) {
      totals.gold += eq.goldCost;
    }
  });

  return totals;
}

// Get equipment by slot
export function getEquipmentBySlot(slot) {
  return equipmentData.filter(eq => eq.type === slot);
}

// Get equipment by quality
export function getEquipmentByQuality(quality) {
  return equipmentData.filter(eq => eq.quality === quality);
}

export default equipmentData;

